import React from "react";
import { Carousel, Container } from "react-bootstrap";
import styled from "@emotion/styled";
import "bootstrap/dist/css/bootstrap.min.css";
import img1 from "assets/images/fondo3.jpg"
import img2 from "assets/images/fondo4.jpg"
import img3 from "assets/images/fondo5.png"


const GradientImage = styled("div")(({ theme }) => ({
  backgroundImage: `linear-gradient(to bottom, rgba(41, 73, 255,0.2) 0%, rgba(41, 73, 255,0.8) 100%), url(${img1})`,
  backgroundSize: "cover",
  backgroundPosition: "center",
  height: "35vw", // Ajusta la altura según tus necesidades
  width: "100%",
  position: "relative",
  "& h3": {
    position: "absolute",
    bottom: theme.spacing(2),
    left: theme.spacing(2),
    color: "#fffff",
  },
}));

function Carrusel() {
  return (
    <Container>
      <Carousel>
        <Carousel.Item>
          <GradientImage>
            <h3>Comienzos de integración a invernadero</h3>
          </GradientImage>
        </Carousel.Item>
        <Carousel.Item>
          <GradientImage style={{backgroundImage: `linear-gradient(to bottom, rgba(41, 73, 255,0.2) 0%, rgba(41, 73, 255,0.8) 100%), url(${img2})`}}>
            <h3>Forma ejemplificada del invernadero</h3>
          </GradientImage>
        </Carousel.Item>
        <Carousel.Item>
        <GradientImage style={{backgroundImage: `linear-gradient(to bottom, rgba(41, 73, 255,0.2) 0%, rgba(41, 73, 255,0.8) 100%), url(${img2})`}}>
            <h3>Forma ejemplificada del invernadero</h3>
          </GradientImage>
        </Carousel.Item>
      </Carousel>
    </Container>
  );
};

export default Carrusel;
